import './App.css';
import ToDoList from './component/ToDoList/ToDoList';
function App() {
  function itemClick(item) {
    console.log(item);
  }
  const listToDo = [{ id: 1, title: "Title 1" }, { id: 2, title: "Title 2" }, { id: 3, title: "Title 3" }];
  return (
    <div className="App">
      <ToDoList clickToItem={() => itemClick} listToDo={listToDo}></ToDoList>
    </div>
  );
}

export default App;
